import bisect

def solver(nums): 
    encountered = [] # maintained in descending order 
    nums.reverse()
    res = [] 
    for i, a in enumerate(nums): 
        if res == [] or a <= encountered[-1]: 
            res.append(0) 
            encountered.append(a)
            continue 
        for j in range(len(encountered)): 
            if encountered[j] < a: 
                res.append(len(encountered) - j)
                encountered.insert(j, a)
                break 
    res.reverse()
    return res
def reimplementation(nums):
    encountered = []  # Maintained in ascending order
    res = []
    nums.reverse()

    for a in nums:
        if res == []: 
            res.append(0)
            encountered.append(a)
        elif a > encountered[-1]:
            res.append(len(encountered))
            encountered.append(a)
        else:
            index = bisect.bisect_left(encountered, a)
            res.append(index)
            encountered.insert(index, a)

    res.reverse()
    return res


